import { useEffect, useState } from "react";
import { connect } from "react-redux";
import axios from "axios";
import getItem from "./Redux/action/itemAction";
import incr from "./Redux/action/action"; //import file
import { decr } from "./Redux/action/action"; //function import
import { amount } from "./Redux/action/action";
import { useDispatch } from "react-redux";

function Items(props) {
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(props.amount(3));
  }, []);

  function reset() {
    return props.amount(3);
  }
  return (
    <>
      <h2>All Items</h2>
      {props.statvalue}
      <button onClick={props.incr}>increment</button>
      <button onClick={props.decr}>decrement</button>
      <button onClick={reset}>reset</button>
    </>
  );
}

const mapStateToProps = (state) => ({
  statvalue: state,
});
export default connect(mapStateToProps, { incr, decr, amount })(Items);
